import Trellie from "../Component/Trellie";
import trellies from "../Data/trellies"
import './App.css';

const App = () => {
  let render = trellies.map(object => {
    return <Trellie key={object.id} trellie={object}/>
  });

  return( 
    <>
      {render}
    </>
  );
}

export default App;
